import styled from 'styled-components'

export const StyledContainer = styled.div`
   
   max-width: 100%;
   background: rgb(63,94,251);
background: linear-gradient(142deg, rgba(63,94,251,1) 13%, rgba(252,70,107,0.05085784313725494) 77%);

   article {
        display: flex;
   }
`
